import React from 'react';
import style from './Category.module.css';
import Category_container from './Category_container';

function Category({textChanged}) {
  if (!textChanged) {
    return null;
  }

  return (
    <div className={style.container}>
      <Category_container>2022</Category_container>
      <Category_container>2021</Category_container>
      <Category_container>2020</Category_container>
      <Category_container>2019</Category_container>
    </div>
  );
}

export default Category;
